import Hero from '../components/Hero';
import About from './About';
import Services from './Services';
import WhyChoose from '../components/WhyChoose';
import WhoWeServe from '../components/WhoWeServe';
import Technology from '../components/Technology';
import Pricing from '../components/Pricing';

const Home = () => {
  return (
    <>
      <div id="home" style={{ height: '100vh', background: 'lightblue' }}>Hero Section</div>
      <div id="about" style={{ height: '100vh', background: 'lightgreen' }}>About Section</div>
      <div id="services" style={{ height: '100vh', background: 'lightcoral' }}>Services Section</div>
      {/* Other sections */}
    </>
  );
};

export default Home;
